import React from 'react';
import { useEffect, useState } from 'react';

export default function Home() {
    const [commessa, setCommessa] = useState([]);

    // GET operation with fetch API
    useEffect(() =>{
      const fetchCommessa = async () => {
        const response = await fetch('http://localhost:8080/commessa');
        const data = await response.json();
        console.log(data);
        setCommessa(data);
      };
      fetchCommessa();
    },[]);

  return (
    <div className="container">
        <div className="py-4">
            <table className="table border shadow">
                <thead>
                    <tr>
                    <th scope="col">id</th>
                    <th scope="col">Title</th>
                    <th scope="col">Last</th>
                    <th scope="col">Handle</th>
                    <th scope="col">Action</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        commessa.map((commessa,id)=>(
                            <tr>
                            <th scope="row" key={commessa.id}>1</th>
                            <td>{commessa.titolo}</td>
                            <td>{commessa.descrizione}</td>
                            <td>@fat</td>
                            <td>
                                <button className="btn btn-primary mx-2">View</button>
                                <button className="btn btn-outline-primary mx-2">Edit</button>
                                <button className="btn btn-danger mx-2">Delite</button>
                            </td>
                            </tr>
                        ))
                    }
                </tbody>
            </table>
        </div>
    </div>
  )
}
